import styled from 'styled-components';

export const Container = styled.nav`
    padding: 0 2rem;
    width: 100%;
    max-width: 1920px;
    a{
      text-align: left;
      font: normal normal medium 30px/38px;
      font-weight: 600;
      letter-spacing: 0px;
      color: #071242;
      opacity: 1;
      text-decoration: none;
      & + a{
        margin-left: 33px;
      };
    };
`
